CREATE TABLE `alumnos_caracterizacion` (
  `se_no_ficha` varchar(10) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'Numero de ficha o folio generado',
  `se_no_control` varchar(10) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'Numero de control de alumno.',
  `se_fecha_ficha` varchar(30) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Fecha en la que solicito una ficha',
  `se_procedencia_foraneo` bit(1) NOT NULL COMMENT '¿El alumno es foráneo?',
  `se_esc_proced` varchar(60) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'Nombre de la escuela de procedencia del alumno de nuevo ingreso.',
  `se_esc_proced_mun` varchar(60) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'Municipio de la escuela de procedencia.',
  `se_esc_proced_edo` varchar(20) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'Estado de la escuela de procedencia.',
  `se_bachillerato_prom` double NOT NULL COMMENT 'Promedio obtenido en el bachillerato por el alumno de nuevo ingreso.',
  `se_bachillerato_tipo` varchar(50) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'Tipo de bachillerato que curso el alumno de nuevo ingreso.',
  `sa_corrimiento_listas` varchar(8) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'Indica si el alumno hizo el examen\r\nde admisión en primera, segunda,\r\ntercera o cuarta vuelta.',
  `sa_grupo_gen` varchar(10) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Grupo de generación al que fue\r\nasignado el alumno de nuevo\r\ningreso.',
  `sa_exam_adm_res` int(11) DEFAULT NULL COMMENT 'Calificación obtenida en el examen\r\nde admisión.',
  `tut_probpsico_depresion` varchar(8) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Descripción de problemas\r\npsicológicos de depresión del\r\nalumno. (Mínimo, Leve,\r\nModerado, Severo)',
  `tut_probpsico_autoestima` varchar(5) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Descripción de problemas\r\npsicológicos de autoestima del\r\nalumno. (baja, poca, buena, alta)',
  `tut_probpsico_machover` varchar(300) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Descripcion de problemas psicológicos de machover',
  `tut_probpsico_diagnostico` varchar(10) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Diagnóstico de problemas\r\npsicológicos. (Ninguno, leve,\r\nmoderado, grave).',
  `tut_probmed_peso` varchar(20) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Descripción de problemas médicos\r\nde peso del alumno. (Bajo Peso,\r\nNormal, Sobrepeso, Obesidad)',
  `tut_probmed_enf` varchar(300) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Descripción de problemas médicos\r\nde enfermedades del alumno.',
  `tut_probmed_ad` varchar(15) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Descripción de problemas médicos\r\ncon drogas y alcohol del alumno.\r\n(Leve, moderado y grave)',
  `tut_probmed_alergias` varchar(300) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Descripción de problemas médicos',
  `tut_probmed_alergmed` varchar(300) COLLATE utf8_spanish2_ci DEFAULT NULL,
  `tut_probmed_enf_hered` varchar(15) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Descripción de problemas médicos\r\nde enfermedades hereditarias del\r\nalumno. (Predisposición, Normal).',
  `tut_probfam_res` varchar(9) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Resultado de problemas',
  `tut_hab_estudio` varchar(9) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Resultado de test de hábitos de estudio. (Buenos, regulares, malos).',
  `tut_orient_vocacional` varchar(10) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Orientación vocacional del alumno\r\nde nuevo ingreso',
  `tut_opc_esc` varchar(10) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT '¿Qué opción es la institución?',
  `tut_carrera_trunca` varchar(50) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Nombre de la carrera Trunca.',
  `doc_curso_algebra_res` int(11) DEFAULT NULL COMMENT 'Resultado obtenido en el curso de algebra.',
  `doc_curso_regul_res` int(11) DEFAULT NULL COMMENT 'Resultado obtenido en el curso de\r\nregularización.',
  `est_se_ingresos_todos` int(11) DEFAULT NULL COMMENT 'Suma de todos los ingresos del\r\nalumno.',
  `se_ocasiones_ingreso` int(11) DEFAULT NULL COMMENT 'Indica con un número si el alumno\r\nanteriormente estuvo inscrito en\r\nla institución.',
  `tut_becas` bit(1) DEFAULT NULL,
  `tut_becas_detalles` varchar(100) COLLATE utf8_spanish2_ci DEFAULT NULL,
  `tut_vivir_con` int(11) DEFAULT NULL,
  `tut_trabajo_lugar` varchar(50) COLLATE utf8_spanish2_ci DEFAULT NULL,
  `tut_trabajo_horario` varchar(20) COLLATE utf8_spanish2_ci DEFAULT NULL,
  KEY `se_no_ficha` (`se_no_ficha`),
  KEY `se_no_control` (`se_no_control`),
  CONSTRAINT `alumnos_caracterizacion_ibfk_1` FOREIGN KEY (`se_no_ficha`) REFERENCES `alumnos_datos_personales` (`se_no_ficha`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `alumnos_caracterizacion_ibfk_2` FOREIGN KEY (`se_no_control`) REFERENCES `alumnos_datos_personales` (`se_no_control`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;
