INSERT INTO `ta_segmento_a` VALUES (1,'¿Ha renunciado a una actividad laboral, social o recreativa, debido al consumo de alcohol o de drogas?'),(2,'¿Ha tenido problemas físicos, psicológicos o sociales causados o empeorados por el consumo del alcohol o drogas?'),(3,'¿Ha continuado consumiendo alcohol o drogas a pesar de saber que le causaban o le empeoraban los problemas físicos, psicológicos o sociales?'),(4,'¿Su tolerancia (capacidad de consumir mucho alcohol o drogas sin sentirse intoxicado) aumento radicalmente desde que empezó a tomarlos?'),(5,'¿Alguna vez se ha sentido incomodo o enfermo después de consumir alcohol o drogas?');
