/*!40000 ALTER TABLE `ta_segmento_c` DISABLE KEYS */;
INSERT INTO `ta_segmento_c` VALUES (1,'A la hora de tomar decisiones en tu vida, como poner cosas nuevas en el trabajo, iniciar alguna actividad de ocio, o elegir alguna ropa para vestir, ¿Sueles buscar la aprobación o el apoyo de las personas que te rodean?','No, consideras que tu opinión es buena y que la de los demás no tiene por qué serlo siempre','Sí, pero solo ante las decisiones que consideras demasiado importantes como para actuar precipitadamente','Sí, siempre que puedes consultas con los demás. Te equivocas con frecuencia y quieres hacer las cosas bien','Depende de la decisión. Sueles tener claro lo que vas a hacer, pero consideras las posibilidades que te ofrecen los demás.'),(2,'Un día conoces a alguien nuevo y muy interesante, estas charlando animadamente y llega el momento de hablar de ti, ¿Cuál de las siguientes opciones se ajusta mejor a lo que cuentas?','No crees que tengas mucho que contar, tu trabajo es muy corriente, tus amigos son normales y tus aficiones también. Prefieres que esta persona te cuente su vida','Tu trabajo te gusta y aunque sea corriente, siempre lo enfocas desde una perspectiva interesante, tus aficiones son tu pasión y disfrutas hablando de ellas, también hablas de tus proyectos futuros','Hablas en líneas generales de tu trabajo y de tus aficiones, sobre todo, hablas de tus amigos y de lo más interesante de sus vidas.','Más que de tu trabajo actual, hablas de tus proyectos, tus objetivos, de lo que vas a hacer para lograrlos, de lo buenas que son tus amistades y lo poco usual de tus aficiones. Te gusta hablar de ti'),(3,'En tu lugar de trabajo o de estudios, se está explicando algo que es completamente nuevo para ti. Llega un momento en que te das cuenta que no has entendido casi nada ¿Qué haces?','Paras al explicación y requieres que empiece de nuevo, si tu no lo entiendes habrá mucha gente que tampoco lo haga','Si hay más gente que pregunte tu también lo haces, si no, buscas en una parte al ponente para que te aclare las dudas','Te da mucha vergüenza preguntar y demostrar así que no entiendes. Más tarde preguntaras a algún amigo o intentaras informarte por tu cuenta','Tomas nota de lo que no entiendes para preguntarlo al finalizar de la charla, si sigues con duda pedirás información complementaria para prepararte mejor.'),(4,'Imagina que estas en un trabajo y están buscando a una persona que represente a la empresa en un concurso del ramo. Piden una persona que cumpla unos requisitos, entre ellos, explicar bien el trabajo que se hace y que haga una demostración práctica del mismo. ¿Qué harías?','No te planteas ser voluntario, hay mil personas más capacitadas que tu para la demostración y no se te da bien hablar en público.','Te presentas voluntario, puede ser una experiencia interesante y si sales elegido puedes hacer una presentación innovadora.','No te presentas, serias capaz de hacerla bien pero crees que hay gente mejor preparada y más original que tú.','Te presentas y estas casi seguro de que te elegirán, haces buenos proyectos y darás una buena imagen a la empresa.'),(5,'En una fiesta en la que no conoces a nadie excepto a los anfitriones, te presentan un grupo de personas de aspecto interesante.  ¿Cuál es tu actitud?','Te interesa conocerlos no solo para pasar un buen rato en la reunión sino porque puede ser una forma de iniciar una amistad.','Esperas causarle una buena impresión y decir cosas que les puedan interesar.','Te gustaría llevarles a tu terreno en la conversación para así poder hablar de los temas que mas te interesan.','Antes de iniciar una conversación escuchas lo que dicen y esperas temas que tú conozcas para hablar.');
/*!40000 ALTER TABLE `ta_segmento_c` ENABLE KEYS */;
UNLOCK TABLES;

